import React from "react";
import {NavLink} from 'react-router-dom';

import "./Navbar.css";
import logo from '../../img/logo.png';


const navbar = (props) => (
  <div className="main-nav">
    <div className="container">
    <h2 className="nav-items"><img src={logo} alt=""/>{props.title}</h2>
        <ul className="nav-menu">
          <li><NavLink className="nav-menu__link" exact to="/" >Home</NavLink></li>
          <li><NavLink className="nav-menu__link" exact to="/" >About</NavLink></li>
          <li><NavLink className="nav-menu__link" exact to="/" >Where to go?</NavLink></li>
          <li><NavLink className="nav-menu__link" exact to="/" >Contact</NavLink></li>
        </ul>

    </div>
  </div>

);

export default navbar;
